B.aCp=new A.RU("Button Image Slider",34,"With Left Right Buttons","class ButtonImageSlider extends StatefulWidget {\n  const ButtonImageSlider({super.key});\n\n  @override\n  State<ButtonImageSlider> createState() =>\n      _ButtonImageSliderState();\n}\n\nclass _ButtonImageSliderState extends State<ButtonImageSlider> {\n  final PageController _controller = PageController();\n  final List<String> images = [\n    'assets/eample.jpg',\n    'assets/example2.jpg',\n    'assets/example3.jpg',\n  ];\n  int _currentPage = 0;\n\n  @override\n  void initState() {\n    super.initState();\n    // Add listener to detect changes in the page\n    _controller.addListener(() {\n      if (_controller.page != null) {\n        setState(() {\n          _currentPage = _controller.page!.round();\n        });\n      }\n    });\n  }\n\n  @override\n  void dispose() {\n    // Dispose the controller when the widget is disposed\n    _controller.dispose();\n    super.dispose();\n  }\n\n  void _navigateToPage(int page) {\n    _controller.animateToPage(\n      page,\n      duration: const Duration(milliseconds: 300),\n      curve: Curves.easeInOut,\n    );\n  }\n\n  @override\n  Widget build(BuildContext context) {\n    return Card(\n      elevation: 4,\n      shape: const RoundedRectangleBorder(\n        borderRadius: BorderRadius.all(Radius.circular(12)),\n      ),\n      child: Container(\n        width: 500,\n        height: 250, // Set height for the image slider\n        decoration: const BoxDecoration(\n          color: Colors.white,\n          borderRadius: BorderRadius.all(Radius.circular(12)),\n          boxShadow: [\n            BoxShadow(\n              color: Colors.black12,\n              blurRadius: 8,\n              offset: Offset(0, 4),\n            ),\n          ],\n        ),\n        child: Stack(\n          children: [\n            PageView.builder(\n              controller: _controller,\n              itemCount: images.length,\n              itemBuilder: (context, index) {\n                return ClipRRect(\n                  borderRadius: BorderRadius.all(Radius.circular(12)),\n                  child: Image.asset(\n                    images[index],\n                    fit: BoxFit.cover,\n                    width: double.infinity,\n                  ),\n                );\n              },\n            ),\n            // Left Button\n            Positioned(\n              top: 100,\n              left: 10,\n              child: IconButton(\n                icon: const Icon(\n                  Icons.arrow_left,\n                  color: Colors.white,\n                  size: 30,\n                ),\n                onPressed: () {\n                  if (_currentPage > 0) {\n                    _navigateToPage(_currentPage - 1);\n                  }\n                },\n              ),\n            ),\n            // Right Button\n            Positioned(\n              top: 100,\n              right: 10,\n              child: IconButton(\n                icon: const Icon(\n                  Icons.arrow_right,\n                  color: Colors.white,\n                  size: 30,\n                ),\n                onPressed: () {\n                  if (_currentPage < images.length - 1) {\n                    _navigateToPage(_currentPage + 1);\n                  }\n                },\n              ),\n            ),\n            // Pagination Indicator\n            Positioned(\n              bottom: 10,\n              left: 10,\n              child: Row(\n                children: List.generate(images.length, (index) {\n                  return Container(\n                    margin: const EdgeInsets.symmetric(horizontal: 4),\n                    width: 8,\n                    height: 8,\n                    decoration: BoxDecoration(\n                      color: _currentPage == index\n                          ? Colors.blue\n                          : Colors.grey,\n                      shape: BoxShape.circle,\n                    ),\n                  );\n                }),\n              ),\n            ),\n          ],\n        ),\n      ),\n    );\n  }\n}",B.Uf,null)
